import React, { useState, useEffect ,handleTyping } from 'react';
//import CountryList from './CountryList';
import './app.css'
import axios from 'axios'
import Selection from './Selection'
import {text} from './Search'
import Search from './Search'

function App(props) {

    const [cards, setCards] = useState([])
    const [search ,setSearch] = useState('')

console.log(props.val)
    useEffect(() => {
        axios
            .get('https://corona.lmao.ninja/v2/countries/')
            .then(res => {
                setCards(res.data.filter(countery => countery.country.includes('')).map((countery, index) => {
                    //console.log(text)
                    return {
                        id: `${index}`,
                        countery: countery.country,
                        flag: countery.countryInfo.flag,
                        population: countery.population,
                        active: countery.active,
                        deaths: countery.deaths,
                    }
                }))
            })
    }, [])

    return (
        <>
              <div className="selecetColor" > 
               <Search search = {search} />              
              </div>
        <div className = "wraps">
        <Selection cards = { cards }/>
        </div>

         </>
          
    );
}

export default App;
